2001-05-11 - Art Bell Somewhere in Time - David Livingston - Richard C. Hoagland - Space Tourism 

Art Bell: Somewhere in Time travels back to May 11, 2001, when Art was joined by Dr. David Livingston to discuss how private companies need to be investing in space tourism and how one day we will all be able to travel among the stars. Get this weeks Somewhere in Time, before its time.  Length 3:17:51  Full 5 hour show.
